package com.neuedu.test;/** * Created by admin on 2020/2/10. */public class Mybook {    private  String name;    private double price;    private String press;    private String author;    private String bookISBN;    public Mybook() {    }    public Mybook(String name, double price, String press, String author, String bookISBN) {        this.name = name;        this.price = price;        this.press = press;        this.author = author;        this.bookISBN = bookISBN;    }    public String getName() {        return name;    }    public double getPrice() {        return price;    }    public String getPress() {        return press;    }    public String getAuthor() {        return author;    }    public String getBookISBN() {        return bookISBN;    }    @Override    public String toString() {        return "Mybook{" +                "name='" + name + '\'' +                ", price=" + price +                ", press='" + press + '\'' +                ", author='" + author + '\'' +                ", bookISBN='" + bookISBN + '\'' +                '}';    }}